import React from 'react';
import Slider from 'react-slick';
import './style.css';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
export default function UpcomingEvents() {
    const settings = {
      
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
     
    };

    return (
        <div className="upcoming pt-4">
             <div className="container ">
            <div className="heading1">
                <h3 className="mb-0 h1" style={{color: "black"}}>Upcoming Events</h3>
            </div>
            <Slider {...settings}>
                
                <div className='upcoming-img'>
                    <img src='../assets/Upcoming/upcoming-1-apr.webp' alt='upcoming' />
                    <div className="designation-overlay">
                        
                        
                    </div>
                </div>
                <div className='upcoming-img'>
                    <img src='../assets/upcoming/upcoming-2-apr.webp' alt='upcoming' />
                    <div className="designation-overlay">
                    
                        
                    </div>
                </div>
                
            </Slider>
        </div>
        </div>
    );
}
